/* For (equilibrium) correlation length */ /*{{{*/
// Magnetization
double M(double R, double Theta){ return M0*pow(R,beta)*Theta;}
// Scaling variable z
double z(double R, double Theta){ 
	return 2.0/(1.0+((1.0/3.0)*((fabs(R*(1-Theta*Theta)))/(pow(fabs(M0*pow(R,beta)*Theta),(1/beta))))));
}
// Epsilon expansion of scaling function g
double gEpsExp(double R, double Theta){   
	return pow(6.0,(-2.0*nu))*(z(R,Theta))*(1.0 - ((1.0/36.0)*epsilon*(((5.0+(6.0*log(3.0)))*z(R,Theta))-(6*(1.0+z(R,Theta))*log(z(R,Theta))))) + ((epsilon*epsilon)*((((1.0/72.0)*(1.0+(2.0*z(R,Theta)*z(R,Theta))))*log(z(R,Theta))*log(z(R,Theta)))+((((z(R,Theta)/18.0)*(z(R,Theta)-(1.0/2.0))*(1.0-log(3.0)))-((1.0/216.0)*((16.0*z(R,Theta)*z(R,Theta))-((47.0/3.0)*z(R,Theta))-(56.0/3.0))))*log(z(R,Theta)))+(((1.0/216.0)*((101.0/6.0)+((2.0/3.0)*I)+(6.0*log(3.0)*log(3.0))+(4.0*log(3.0))-10.0))*z(R,Theta)*z(R,Theta))-(((1.0/216.0)*((6.0*log(3.0)*log(3.0))+((44.0/3.0)*log(3.0))+(137.0/9.0)+((8.0/3.0)*I)))*z(R,Theta)))));
}
// Asypmtotic form of scaling function g
double gAsymp(double R, double Theta){    
	return pow((1.0/(3.0+((fabs(R*(1-Theta*Theta)))/(pow(fabs(M0*pow(R,beta)*Theta),(1/beta)))))),(2.0*nu));
}
// Correlation length in epsilon expansion
double CalcCorrLengthEpsExp(double R, double Theta){    
	return sqrt(aa*aa*(pow((fabs(M(R,Theta))),(-2.0*nu/beta)))*fabs(gEpsExp(R,Theta)));
}
// Correlation length in epsilon expansion
double CalcCorrLengthAsympt(double R, double Theta){   
	return sqrt(aa*aa*(pow((fabs(M(R,Theta))),(-2.0*nu/beta)))*gAsymp(R,Theta));
}
