/* For gaussian filtering */ /*{{{*/
double GausFunc (double x, double y, double sigmax, double sigmay){
	return 1.0/sqrt(2.0*PI*sigmax*sigmax*sigmay*sigmay)*exp(-x*x/(2.0*sigmax*sigmax)-y*y/(2.0*sigmay*sigmay));
} /*}}}*/

